C.Ug=new L.y("Turn ON for a white app bar on light theme, a popular design on iOs. This settings overrides all other app bar color selections and disables app bar color selection on custom theme",null,null,null,null,null,null,null,null)
C.Uh=new L.y("White app bar",null,null,null,null,null,null,null,null)
