C.Wf=new L.y("Menu animation duration",null,null,null,null,null,null,null,null)
C.Wg=new L.y("Side border on drawers in dark mode",null,null,null,null,null,null,null,null)
C.Wi=new L.y("Company Ltd",null,null,null,null,null,null,null,null)
C.Wj=new L.y("Break from rail to side menu at width",null,null,null,null,null,null,null,null)
C.Wl=new L.y("The switch list tile is ON",null,null,null,null,null,null,null,null)
C.Wm=new L.y("Not a very common design but can look nice too. This setting overrides all other color selections, also true black and disables app bar color selection on custom theme",null,null,null,null,null,null,null,null)
C.Wn=new L.y("Normal app bars can be a bit dull. This demo shows how you can make them more interesting by introducing a gradient into them, together with an optional transparency that also increases gradually.\n\nThe reason for the gradient is just to make the app bar more dynamic and interesting. Whereas the gradient transparency is used to display content behind the app bar as content scrolls below it.\n\nA transparent gradient that is fully opaque at the start of the app bar and increases in transparency towards the end, ensures that the title is always legible and keeps the effect subtle. A gradient and transparent app bar is still a matter of opinion and you can turn them off, as well as the scrolling behind the app bar or don't use the optional styled app bar constructor at all.\n",null,null,null,null,null,null,null,null)
C.Wo=new L.y("Side borders on drawers in dark mode are ON by default. In true black mode they are really needed. With the API you can change their color. There is also an API to enable side borders for light mode. It is OFF by default as it is normally not needed",null,null,null,null,null,null,null,null)
